/*
 *
 *	MC-8123 Emulator
 *
 */

import Z80 from './z80.js';
import {bitswap} from './utils.js';

export default class MC8123 extends Z80 {
	code_key = new Uint8Array(0x10000);
	data_key = new Uint8Array(0x10000);

	constructor(key, clock) {
		super(clock);
		for (let i = 0; i < 0x10000; i++) {
			const idx = bitswap(i, 15, 14, 13, 12, 11, 10, 8, 6, 4, 2, 1, 0);
			this.code_key[i] = key[idx];
			this.data_key[i] = key[0x1000 | idx];
		}
	}

	fetchM1() {
		const addr = this.pc;
		return code_table[this.code_key[addr] << 8 | super.fetchM1()];
	}

	fetch() {
		const addr = this.pc;
		return data_table[this.data_key[addr] << 8 | super.fetch()];
	}

	read(addr) {
		return data_table[this.data_key[addr] << 8 | super.read(addr)];
	}
}

